const testReceiptHtml = `
   *<br><!-- character helps to indicate cut-off -->
  <h3>Here is my example receipt.</h3>
  <p>It also includes a QR code.</p>
  <img style="width: 100%" src="data:image/png;base64,">
  <p>Thank you for using our kiosk.</p>
  *<br><!-- character helps to indicate cut-off -->
  `;


const eflyn = EflynSdk.connectClient();

function kioskPrintingExample() {
  console.log('[kioskPrintingExample]');
  /* Start example using EsuiteSdk object */

  eflyn.printer.printHtml({
    html: testReceiptHtml,
    printerName: null
  });
  /* End example */
}

function takePaymentsExample() {
  console.log('[takePaymentsExample]');
  /* Start example using EsuiteSdk object */
  eflyn.payment.approve({
    amount: 5.00,
    invoice: 'invid'
  });
  /* End example */
}

function readBarcodesExample() {
  console.log('[readBarcodesExample]');
  /* Start example using EsuiteSdk object */
  eflyn.on('barcode.read', (event) => {
    alert(event.data.code);
  });
  /* End example */
}

function sendNotificationsExample() {
  console.log('[sendNotificationsExample]');
  /*
  name: string;
  print: string;
  email?: string;
   */
  /* Start example using EsuiteSdk object */
  eflyn.receipt.submit({
    name: 'Example Notification',
    email: null, // Autofill the email field.
    print: testReceiptHtml,
  });
  /* End example */
}

